import React from "react";

const Display = props => {
  return (
    <div>
      <ul className="display">
        {props.users.map(item => {
          return (
            <li key={item.id}>
              Name : {item.name}, Company: {item.company.name}, Website:{" "}
              {item.website}
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default Display;
